export async function importThailandData() {
  console.log('📍 开始导入完整泰国行政区数据...')
  
  try {
    const existingCount = await AdministrativeRegion.count()
    if (existingCount > 0) {
      console.log(`ℹ️  行政区数据已存在 (${existingCount} 条记录)，跳过导入`)
      return
    }
    
    console.log(`📊 准备导入 ${THAILAND_REGIONS_DATA.length} 条行政区数据...`)
    
    // 分批导入，避免内存问题
    const batchSize = 1000
    let imported = 0
    
    for (let i = 0; i < THAILAND_REGIONS_DATA.length; i += batchSize) {
      const batch = THAILAND_REGIONS_DATA.slice(i, i + batchSize)
      await AdministrativeRegion.bulkCreate(batch, {
        ignoreDuplicates: true
      })
      imported += batch.length
      console.log(`✅ 已导入 ${imported}/${THAILAND_REGIONS_DATA.length} 条记录`)
    }
    
    const finalCount = await AdministrativeRegion.count()
    console.log(`🎉 泰国行政区数据导入完成！总计 ${finalCount} 条记录`)
    
  } catch (error) {
    console.error('❌ 导入泰国行政区数据失败:', error)
    throw error
  }
}

// 获取统计信息
export function getDataStats() {
  const provinces = THAILAND_REGIONS_DATA.filter(r => r.level === 1)
  const districts = THAILAND_REGIONS_DATA.filter(r => r.level === 2)  
  const subDistricts = THAILAND_REGIONS_DATA.filter(r => r.level === 3)
  
  return {
    total: THAILAND_REGIONS_DATA.length,
    provinces: provinces.length,
    districts: districts.length,
    subDistricts: subDistricts.length
  }
}